import * as React from 'react';
import { View } from 'react-native';
import { Divider, Text } from 'react-native-paper';

const Home = () => (
  <View>
    <Text>Lemon</Text>
    <Divider />
    <Text>Mango</Text>
    <Divider />
  </View>
);

export default Home;
